import React from "react";
import Input from "./Input";

const Header = () => {
  return (
    <div>
      <form>
        <label htmlFor="search">Search Book</label>
        <Input type="text" name="search" value="type here to find book" />
      </form>
    </div>
  );
};

export default Header;
